patch:
diff --git a/include/hermes/VM/JSCallableProxy.h b/include/hermes/VM/JSCallableProxy.h
index 5aab5d3de..c4e27d813 100644
--- a/include/hermes/VM/JSCallableProxy.h
+++ b/include/hermes/VM/JSCallableProxy.h
@@ -37,9 +37,13 @@ class JSCallableProxy : public NativeFunction {
       Handle<JSObject> target,
       Handle<JSObject> handler);

-  bool isConstructor(Runtime *runtime) {
-    return vm::isConstructor(
-        runtime, vmcast_or_null<Callable>(slots_.target.get(runtime)));
+  bool isConstructor(Runtime *runtime, int depth = 0) {
+    if (depth > hermes::vm::kIsConstructorMaxDepth) {
+      // Too deep, likely a cycle.
+      return false;
+    }
+    return vm::isConstructorWithDepth(
+        runtime, vmcast_or_null<Callable>(slots_.target.get(runtime)), depth + 1);
   }

 #ifdef HERMESVM_SERIALIZE
diff --git a/include/hermes/VM/Operations.h b/include/hermes/VM/Operations.h
index a1f476466..f8d40eda2 100644
--- a/include/hermes/VM/Operations.h
+++ b/include/hermes/VM/Operations.h
@@ -361,7 +361,11 @@ bool isConstructor(Runtime *runtime, HermesValue value);
 /// ES7 7.2.4
 /// Returns true if \c callable is a constructor.  Passing \c nullptr
 /// is allowed, and returns false.
-bool isConstructor(Runtime *runtime, Callable *callable);
+constexpr int kIsConstructorMaxDepth = 100;
+bool isConstructorWithDepth(Runtime *runtime, Callable *callable, int depth = 0);
+inline bool isConstructor(Runtime *runtime, Callable *callable) {
+  return isConstructorWithDepth(runtime, callable, 0);
+}

 /// ES6.0 7.2.8
 /// Returns true if the object is a JSRegExp or has a Symbol.match property that
diff --git a/lib/VM/Operations.cpp b/lib/VM/Operations.cpp
index 60820798a..9f9c8e6e4 100644
--- a/lib/VM/Operations.cpp
+++ b/lib/VM/Operations.cpp
@@ -1351,7 +1351,7 @@ bool isConstructor(Runtime *runtime, HermesValue value) {
   return isConstructor(runtime, dyn_vmcast<Callable>(value));
 }

-bool isConstructor(Runtime *runtime, Callable *callable) {
+bool isConstructorWithDepth(Runtime *runtime, Callable *callable, int depth) {
   // This is not a complete definition, since ES6 and later define member
   // functions of objects to not be constructors; however, Hermes does not have
   // ES6 classes implemented yet, so we cannot check for that case.
@@ -1382,7 +1382,7 @@ bool isConstructor(Runtime *runtime, Callable *callable) {
   // JSCallableProxy is a NativeFunction, but may or may not be a
   // constructor, so we ask it.
   if (auto *cproxy = dyn_vmcast<JSCallableProxy>(callable)) {
-    return cproxy->isConstructor(runtime);
+    return cproxy->isConstructor(runtime, depth);
   }

   return false;
